import React, { Component } from 'react';
import './App.css';
import SideNav from './components/SideNav/sidenav.js';
import TopNav from './components/TopNav/topnav.js';
import Body from './components/Body/body.js';

class App extends Component {
  render() {
    return (
      <div className="App">
        <SideNav />
        <TopNav />
      </div>
    );
  }
}

export default App;
